import React, { useState, useCallback } from 'react'
import { TouchableOpacity } from 'react-native';
import { View, Image, ImageBackground, Text } from 'react-native'
import { SafeAreaProvider, SafeAreaView } from 'react-native-safe-area-context';
import styles from '../App.styles';
import { TextInput } from 'react-native';
import { useFonts } from 'expo-font';
import { Ionicons, FontAwesome, FontAwesome5, Entypo, EvilIcons, Feather, MaterialCommunityIcons, MaterialIcons, AntDesign } from "react-native-vector-icons"

function Login({ navigation }) {

    const [showPassword, setShowPassword] = useState(true);
    const [rememberCheckbox, setRememberCheckbox] = useState(false);

    const [fontsLoaded] = useFonts({
        'Kaushan': require('../assets/fonts/KaushanScript-Regular.ttf'),
        "Allura": require('../assets/fonts/Allura-Regular.ttf'),
        "Montserrat-Black": require('../assets/fonts/Montserrat-Black.ttf'),
        "Montserrat-BlackItalic": require('../assets/fonts/Montserrat-BlackItalic.ttf'),
        "Montserrat-Bold": require('../assets/fonts/Montserrat-Bold.ttf'),
        "Montserrat-BoldItalic": require('../assets/fonts/Montserrat-BoldItalic.ttf'),
        "Montserrat-Italic": require('../assets/fonts/Montserrat-Italic.ttf'),
        "Montserrat-Light": require('../assets/fonts/Montserrat-Light.ttf'),
        "Montserrat-LightItalic": require('../assets/fonts/Montserrat-LightItalic.ttf'),
        "Montserrat-Medium": require('../assets/fonts/Montserrat-Medium.ttf'),
        "Montserrat-MediumItalic": require('../assets/fonts/Montserrat-MediumItalic.ttf'),
        "Montserrat-Regular": require('../assets/fonts/Montserrat-Regular.ttf'),
        "Montserrat-Thin": require('../assets/fonts/Montserrat-Thin.ttf'),
        "Montserrat-SemiBold": require('../assets/fonts/Montserrat-SemiBold.ttf'),
        "Montserrat-SemiBoldItalic": require('../assets/fonts/Montserrat-SemiBoldItalic.ttf'),
        "Montserrat-ThinItalic": require('../assets/fonts/Montserrat-ThinItalic.ttf'),
    });

    const onLayoutRootView = useCallback(async () => {
        if (fontsLoaded) {
            await SplashScreen.hideAsync();
        }
    }, [fontsLoaded]);

    if (!fontsLoaded) {
        return null;
    }

    return (

        <SafeAreaView style={styles.SafeAreaView}>



            <View style={{ width: "100%", padding: 10, alignItems: "center", flex: 1, }}>

                <View style={{ flex: 1, alignItems: "center", width: "100%", justifyContent: "center" }}>
                    <Image
                        resizeMode='contain'
                        style={{ width: 150, height: 125, }}
                        source={require("../img/heroscopeLogo.png")}>
                    </Image>

                    <Text style={{ fontSize: 45, color: "#bf7837", fontFamily: "Allura", }}>Hoşgeldiniz</Text>
                </View>

                <View style={{ flex: 1, alignItems: "center", width: "100%", justifyContent: "center", rowGap: 20, paddingHorizontal: "7.5%", }}>

                    <TextInput id='LoginEmail' placeholder='E-mail' style={{ width: "100%", borderRadius: 10, backgroundColor: "white", justifyContent: "center", padding: 10, borderWidth: 1, borderColor: "#bf7837", fontFamily: "Montserrat-SemiBoldItalic", fontSize: 11.5, color: "#bf7837", }} placeholderTextColor={"#bf7837"}></TextInput>

                    <View style={{ width: "100%", borderRadius: 10, backgroundColor: "white", justifyContent: "center", padding: 10, borderWidth: 1, borderColor: "#bf7837" }}>

                        <TextInput id='LoginPassword' secureTextEntry={showPassword} placeholder='Şifre' style={{ width: "100%", justifyContent: "center", fontFamily: "Montserrat-SemiBoldItalic", fontSize: 11.5, color: "#bf7837", }} placeholderTextColor={"#bf7837"} ></TextInput>

                        <TouchableOpacity onPress={() => { setShowPassword(!showPassword) }} style={{ position: "absolute", width: "10%", height: "100%", alignItems: "center", justifyContent: "center", right: 5 }}>
                            {showPassword &&
                                <Feather name="eye-off" style={{ fontSize: 18 }} />
                            }
                            {!showPassword &&
                                <Feather name="eye" style={{ fontSize: 18 }} />
                            }
                        </TouchableOpacity>

                    </View>

                    <View style={{ width: "100%", padding: 10, flexDirection: "row", alignItems: "center", justifyContent: "space-between" }}>

                        <View style={{ flex: 1, alignItems: "center", flexDirection: "row", justifyContent: "flex-start", columnGap: 7.5, }}>
                            <TouchableOpacity onPress={() => { setRememberCheckbox(!rememberCheckbox) }} style={{ width: 16, height: 16, borderRadius: 5, alignItems: "center", justifyContent: "center", backgroundColor: "white", borderWidth: 1, borderColor: "#bf7837" }}>
                                {!rememberCheckbox &&
                                    <>

                                    </>
                                }
                                {rememberCheckbox &&
                                    <Entypo style={{ fontSize: 12, color: "#bf7837" }} name="check" />
                                }
                            </TouchableOpacity>



                            <View>
                                <Text style={{ fontSize: 11.5, fontFamily: "Montserrat-MediumItalic", color: "#bf7837" }}>Beni hatırla</Text>
                            </View>
                        </View>



                        <TouchableOpacity style={{ flex: 1, alignItems: "flex-end", justifyContent: "center" }}>
                            <Text style={{ fontSize: 11.5, fontFamily: "Montserrat-MediumItalic", color: "#bf7837", textDecorationLine: "underline" }}>Şifremi unuttum</Text>

                        </TouchableOpacity>

                    </View>


                </View>

                <View style={{ flex: 0.5, alignItems: "center", width: "100%", justifyContent: "center", rowGap: 20 }}>

                    <TouchableOpacity onPress={() => { navigation.navigate("Homepage") }} style={{ width: "40%", height: 35, alignItems: "center", justifyContent: "center", borderRadius: 100, backgroundColor: "#bf7837" }}>
                        <Text style={{ fontSize: 12, color: "#f7ede4", fontFamily: "Montserrat-SemiBoldItalic" }}>Giriş Yap</Text>
                    </TouchableOpacity>

                    <TouchableOpacity onPress={() => { navigation.navigate("Register") }} style={{ width: "40%", height: 35, alignItems: "center", justifyContent: "center", borderRadius: 100, borderColor: "#bf7837", borderWidth: 1 }}>
                        <Text style={{ fontSize: 12, color: "#bf7837", fontFamily: "Montserrat-SemiBoldItalic" }}>Kayıt Ol</Text>
                    </TouchableOpacity>

                </View>

            </View>


        </SafeAreaView>
    )
}
export default Login;
